severity = st.number_input("Enter **Casualty Severity** After Accident", min_value=1,max_value=3,help='(1=Fatal , 2=Serius , 3=Slight)')
typeofvehicle = st.number_input("**Type Of Vehicle** That Involved In The Accident (Please look into quastion mark to know more)  ------------->",min_value =1, max_value= 22,help='(1 = Pedal cycle , 2 = M/cycle 50cc and under , 3 = Motorcycle over 50cc and up to 125cc , 4 = Motorcycle over 125cc and up to 500cc , 5 = Motorcycle over 500cc , 6 = [Not used] , 7 = [Not used] , 8 = Taxi/Private hire car , 9 = Car , 10 = Minibus (8 – 16 passenger seats) , 11 = Bus or coach (17 or more passenger seats) , 12 = [Not used] , 13 = [Not used] , 14 = Other motor vehicle , 15 = Other non-motor vehicle , 16 = Ridden horse , 17 = Agricultural vehicle (includes diggers etc.) , 18 = Tram / Light rail , 19 = Goods vehicle 3.5 tonnes mgw and under , 20 = Goods vehicle over 3.5 tonnes and under 7.5 tonnes mgw , 21 = Goods vehicle 7.5 tonnes mgw and over , 22 = Mobility Scooter , 90 = Other Vehicle , 97 = Motorcycle - Unknown CC)')
roadsurface = st.slider('**Road Surface** At The Time Of The Accident (Please look into quastion mark to know more)  ------------->',min_value=1,max_value=5,help='(1 = Dry , 2 = Wet / Damp , 3 = Snow , 4 = Frost / Ice , 5 = Flood (surface water over 3cm deep)')
light = st.slider('Select Street **Lighting** During The Accident (Please look into quastion mark to know more)  ------------->',min_value=1 , max_value= 7,help='(1 = Daylight: street lights present , 2 = Daylight: no street lighting , 3 = Daylight: street lighting unknown , 4  = Darkness: street lights present and lit , 5 = Darkness: street lights present but unlit , 6 = Darkness: no street lighting , 7 = Darkness: street lighting unknown)')

from joblib import load

logreg_model = load('project_3.pkl')
df = pd.read_pickle('train_df.pkl')

input_df = pd.DataFrame({
    'Casualty Severity': [severity],
    'Type of Vehicle': [typeofvehicle]
})


train_df = df[['Casualty Severity','Type of Vehicle']]
result_df = pd.concat([train_df, input_df])

std_scale = StandardScaler()
scaled_result_df = std_scale.fit_transform(result_df)

test_df = scaled_result_df[-1].reshape(1,2) 

pred = logreg_model.predict(test_df)
pred_probability = np.round(logreg_model.predict_proba(test_df), 2)



st.header("Results")


if st.button("Submit"):


    st.info("You can find the result below.")


    from datetime import date, datetime

    today = date.today()
    time = datetime.now().strftime("%H:%M:%S")

    results_df = pd.DataFrame({
    'Name': [name],
    'Surname': [surname],
    'Date': [today],
    'Time': [time],
    'Casualty Severity': [severity],
    'Type of Vehicle': [typeofvehicle],
    'Prediction': [pred],
    'Driver or rider Probability': [pred_probability[:, 1]],
    'Vehicle or pillion passenger Probability': [pred_probability[:, 2]],
    'Pedestrian Probability': [pred_probability[:, 3]],
    })

    results_df["Prediction"] = results_df["Prediction"].apply(lambda x: str(x).replace("1","Driver or rider"))
    results_df["Prediction"] = results_df["Prediction"].apply(lambda x: str(x).replace("2","Vehicle or pillion passenger"))
    results_df["Prediction"] = results_df["Prediction"].apply(lambda x: str(x).replace("3","Pedestrian"))
    st.table(results_df)

    if pred == 1:
        st.image("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRXs9RzH585KbzCjcWAwlANTY89p_vEhO1MNg&usqp=CAU")
